ControlPropertyState.AutoRuleBindingString:
If(cb_Reuniao_3.Selected.Plantao = Blank(), Notify("Selecione um Plantão para começar o Atendimento", NotificationType.Information),
UpdateContext({locPP_CPF:true});
UpdateContext({locCadastrarBeneficiario:true});
UpdateContext({locPP_EditarCadastro:false}));

ClearCollect(colNucleoAscending, 
    SortByColumns(
        bdNucleos,
        "Nucleo", 
        SortOrder.Ascending
    ));

If(inpCPF_Busca_Mascara_1.Text = "", Notify("Selecione Beneficiario para começar o Atendimento", NotificationType.Information),
ClearCollect(colBeneficiario, Filter(dbCadastroBeneficiario, CPF = inpCPF_Busca_Mascara_1.Text));
UpdateContext({locPP_EditCadastro: First(colBeneficiario)});
UpdateContext({locPP_CPF:true});
UpdateContext({locCadastrarBeneficiario:false});
UpdateContext({locPP_EditarCadastro:true}));

If(inpCPF_Busca_Mascara_1.Text = Blank() || First(colBeneficiario).NomeCompleto = Blank(), Notify("Selecione CPF para começar o Atendimento", NotificationType.Information),
UpdateContext({locPP_AtendimentoPlantao:true}));
NewForm(FormCad_AtendimentoPlantao);
ClearCollect(colProdutoEncaminhamento, Filter(dbProdutos, idProduto = "P05"|| idProduto = "P06" ))

If(
    IsBlank(cb_Reuniao_3.Selected.Plantao) || IsBlank(inpCPF_Busca_Mascara_1.Text),
    Notify("Selecione um Plantão e um CPF para começar o Atendimento", NotificationType.Information),
    ClearCollect(colBeneficiario, Filter(dbCadastroBeneficiario, CPF = inpCPF_Busca_Mascara_1.Text));
    UpdateContext({locPP_EditCadastro: First(colBeneficiario)});
    UpdateContext({ocultar_botao_atendimento: true});
    UpdateContext({locPP_HistoricoAtendimento: true});
    UpdateContext({locPP_HistoricoAtendimentoSelo:false});
    UpdateContext({locPP_Atendimento: false});
    UpdateContext({locPP_HistoricoEmergencial:false});
    ResetForm(FormCad_AtendimentoPlantao);
    UpdateContext({locPP_AtendimentoPlantaoHistorico:false});
);
